function parseLastJSON(jsonString) {
    // Check if jsonString is defined and is a string
    if (typeof jsonString !== 'string') {
        throw new TypeError('Input must be a valid JSON string.');
    }

    // Split the string by '{' and reverse the parts
    const parts = jsonString.split('{').reverse();

    for (const part of parts) {
        const jsonPart = `{${part}`;
        try {
            // Try to parse the JSON part
            return JSON.parse(jsonPart);
        } catch (e) {
            continue; // Ignore parse errors and continue
        }
    }
    return null;
}

